using AdventOfCode.Year2023;

namespace AdventOfCodeTests.Year2023
{
    public class Day08Tests
    {
        [Test]
        public void WastelandNavigator_CanReadInput()
        {
            var wastelandNavigator = new WastelandNavigator(exampleInput1);

            wastelandNavigator.Directions.Should().Be("RL");
            wastelandNavigator.Nodes["AAA"].Left.Should().Be("BBB");
            wastelandNavigator.Nodes["AAA"].Right.Should().Be("CCC");
            wastelandNavigator.Nodes["BBB"].Left.Should().Be("DDD");
            wastelandNavigator.Nodes["BBB"].Right.Should().Be("EEE");
        }

        [Test]
        public void WastelandNavigator_CanSolveExample1()
        {
            var wastelandNavigator = new WastelandNavigator(exampleInput1);

            wastelandNavigator.CountSteps("AAA", "ZZZ").Should().Be(2);
        }

        [Test]
        public void WastelandNavigator_CanSolveExample2()
        {
            var wastelandNavigator = new WastelandNavigator(exampleInput2);

            wastelandNavigator.CountSteps("AAA", "ZZZ").Should().Be(6);
        }

        [Test]
        public void WastelandNavigator_CanSolvePart1()
        {
            var wastelandNavigator = new WastelandNavigator(input);

            wastelandNavigator.CountSteps("AAA", "ZZZ").Should().Be(21883);
        }

